import React from 'react'
import Navbar from './Navbar'
import {Link} from 'react-router-dom'
import { useState , useEffect } from 'react'
import axios from "axios"

export const EditProfile = () => {


    const [name,setName] = useState("")
    const [uname,setUname] = useState("")
    const [age,setAge] = useState(0)
    const [phone,setPhone] = useState("123456789")
    

    const [userInfo, setuserInfo] = useState({})

    const currId = "61275e11f0201774782ba0cd"

    useEffect(() => {
        const fetchInfo = async () => {
            try {
                const uinfo = await axios.get(`/user/${currId}`)
                setuserInfo(uinfo.data)
                setName (userInfo.name)
                setUname (userInfo.userName)
                setAge(userInfo.age)
                setPhone(userInfo.contact)
            } catch (err) {
                console.log("Error")
            }
        }
        fetchInfo()
    }, [])

    
    return (
        <div>
            <Navbar/>
        <div className="container">
            <div className="box">
                Update!<br/><br/><br/>

                Name <input type="text" value={name} onChange = {(e)=>setName(e.target.value)} /><br/>
                Uname <input type="text" value={uname}  onChange = {(e)=>setage(e.target.value)}  /><br/>
                Phone <input type="text" value={phone} onChange = {(e)=>setName(e.target.value)} /><br/>
                Umar <input type="number" value={age} onChange = {(e)=>setName(e.target.value)} /><br/>
                
                <br/><br/>

                <button className="signupbutton"> Update! </button> <br/><br/>
            </div>
        </div>
        </div>
    )
}

export default EditProfile
